CREATE TABLE `nutritional_information` (
  `ingredient_id` int NOT NULL AUTO_INCREMENT COMMENT 'รหัสวัตถุดิบ (Primary Key)',
  `ingredient_name` varchar(255) DEFAULT NULL COMMENT 'ชื่อวัตถุดิบ',
  `calories` int DEFAULT NULL COMMENT 'พลังงาน (แคลอรี)',
  `quantity_per_unit` int DEFAULT NULL COMMENT 'ปริมาณต่อหน่วย (กรัม)',
  `protein` double DEFAULT NULL COMMENT 'โปรตีน (กรัม)',
  `fat` double DEFAULT NULL COMMENT 'ไขมัน (กรัม)',
  `carbohydrates` double DEFAULT NULL COMMENT 'คาร์โบไฮเดรต (กรัม)',
  `dietary_fiber` double DEFAULT NULL COMMENT 'ไฟเบอร์ (กรัม)',
  `calcium` double DEFAULT NULL COMMENT 'แคลเซียม (มิลลิกรัม)',
  `iron` double DEFAULT NULL COMMENT 'ธาตุเหล็ก (มิลลิกรัม)',
  `vitamin_c` double DEFAULT NULL COMMENT 'วิตามินซี (มิลลิกรัม)',
  `create_at` timestamp NOT NULL DEFAULT current_timestamp() COMMENT 'สร้างเมื่อวันที่',
  `update_at` datetime NULL DEFAULT NULL COMMENT 'แก้ไขเมื่อวันที่',
  PRIMARY KEY (`ingredient_id`),
  UNIQUE INDEX `ingredient_id_UNIQUE` (`ingredient_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci COMMENT='ตารางเก็บข้อมูลโภชนาการ';


